import './App.css';
import { Button, Grid, Toolbar, IconButton, Typography, AppBar } from '@material-ui/core';
import MenuIcon from '@material-ui/icons/Menu';

function App() {
  var QRCode = require('qrcode.react')
  return (
    <>
      <TopBar />
      <div className="App">
      <div style={{ height: '100%', width: '100vw' }}>
        <Grid container style={{ height: '100%' }}>
          <MainButton buttonName='Get Drink' />
          <MainButton buttonName='Get Favorite' />
          <MainButton buttonName='Get Previous' />
          <MainButton buttonName='New User' />
        </Grid>
      </div>
    </div>
    </>
  );
}

function MainButton({ buttonName }) {
  return <Grid item xs={12} style={{ padding: '5px' }}>
    <Button variant="contained" color="primary"
      style={{ width: '100%', height: '100%' }}>
      {buttonName}
    </Button>
  </Grid>
}

function TopBar() {
  return <AppBar position="static">
    <Toolbar>
      <IconButton edge="start" color="inherit" aria-label="menu">
        <MenuIcon />
      </IconButton>
      <Typography variant="h6" style={{justifyContent: 'center', alignItems: 'center'}}>
        News
      </Typography>
    </Toolbar>
  </AppBar>
}

export default App;
